		window.onload = function() {
			let Pages = {};
			Pages['FluencyCards'] = 'FluencyCards';
			Pages['Jeflen'] = 'Jeflen';
			
			const QueryString = window.location.search;
	
			for(let Key in Pages){
				if(QueryString.includes(Key)){
					window.location.href = Pages[Key];
					break;
				}
			}
		};
	</script>
